jQuery(document).ready((function($){jQuery(document).on("click","#ccfef_elementor_review_dismiss",event=>{jQuery(".ccfef_elementor_review_notice").hide();const btn=jQuery(event.target),nonce=btn.data("nonce"),url=btn.data("url");jQuery.ajax({type:"POST",url:url,data:{action:"ccfef_elementor_review_notice",ccfef_notice_dismiss:!0,nonce:nonce},success:response=>{btn.closest(".elementor-control").remove()},error:(xhr,status,error)=>{console.log(xhr.responseText),console.log(error),console.log(status)}})})}));